import '../css/App.scss';
import Navigation from './Navigation';
import Home from './Home';
import Page1 from './Page1';
import Page2 from './Page2';


function App() {
  return (

      <div className="App" id="App">
        <Navigation/>
        <Home/>
        <Page1/>
        <Page2/>
      </div>
  );
}

export default App;
